import React, { Fragment } from 'react';
import Navbar from '../components/Navbar'

function App() {

  return (
	  <Fragment>
		<div className="App container mt-5">
			<Navbar titulo="Lista de tareas" return="/opo" path="/pokemones"/>
		</div>
	  </Fragment>
  );
}

export default App;
